“Own Your Light” refers to affirming your pride in your culture and countering the narratives surrounding shame around people’s negative internalized views of their Asian American identity. Light also refers to burning bright with pride, confidence, and fierceness . . . lighting the way for others to feel strong enough to come out of the dark . . . leading by example to make our community feel seen and strong, and sharing your strength. 

