“In Filipinx culture, image is everything. How you present yourself to the world (and conversely, how the world perceives you) is a reflection of your character, your values, and your upbringing. My parents taught me to always present myself honorably, which means making sure to filter out parts of myself that are considered transgressive or imperfect. I would like this portrait to show that I have no shame in my image and how I present myself. I am femme. I am fat. I am loud. I am imperfect. And I should be able to share who I am without shame.” (Jeffrey Bonga).

